protos.proto_content:
//__ReflectionProtoName:countdown.proto
syntax = "proto3";

package countdown;


option go_package = "./dto";

message CountdownRequest {
  int32 duration = 1;
}
message CountdownResponse {
  int32 time_left = 1;
}
service Countdown {
  rpc Start (countdown.CountdownRequest) returns (stream countdown.CountdownResponse);
}

//__ReflectionProtoName:process.proto
syntax = "proto3";

package process;


option go_package = "./dto";

message ProcessListRequest {
}
message ProcessListResponse {
  repeated process.Process process_list = 1;
}
message Process {
  string pid = 1;
  string name = 2;
  float cpu = 3;
}
message CPUUsageRequest {
}
message CPUUsageResponse {
  float usage = 1;
}
service ProcessInfo {
  rpc GetProcessList (process.ProcessListRequest) returns (process.ProcessListResponse);
  rpc GetCPUUsage (process.CPUUsageRequest) returns (process.CPUUsageResponse);
}

syntax = "proto3";

package grpc.testing;

// 空消息
message Empty {}

// 简单请求
message SimpleRequest {
  string name = 1;
  int32 id = 2;
}

// 简单响应
message SimpleResponse {
  string message = 1;
  int32 status = 2;
  string timestamp = 3;
}

// 测试服务
service TestService {
  // 空调用 - 返回metadata
  rpc EmptyCall(Empty) returns (Empty) {};

  // 简单调用 - 返回数据和metadata
  rpc SimpleCall(SimpleRequest) returns (SimpleResponse) {};

  // 带metadata的调用
  rpc CallWithMetadata(SimpleRequest) returns (SimpleResponse) {};
}

