# 复杂 JSON 数据结构文档

## 1. 根结构（数组）
| 字段          | 类型        | 必填 | 说明                         |
|---------------|-------------|------|------------------------------|
| `_id`         | `string`    | 是   | 文档唯一标识符               |
| `metadata`    | `object`    | 是   | 元数据对象                   |
| `data`        | `object`    | 是   | 核心数据对象                 |
| `extensions`  | `object`    | 否   | 扩展字段                     |
| `links`       | `object`    | 否   | 关联链接                     |
| `validation`  | `object`    | 否   | 验证信息                     |

## 2. Metadata 对象
| 字段            | 类型        | 必填 | 说明                         |
|-----------------|-------------|------|------------------------------|
| `createdAt`     | `string`    | 是   | ISO 8601 创建时间            |
| `lastModified`  | `object`    | 否   | 最后修改信息                 |

## 3. LastModified 对象
| 字段          | 类型        | 必填 | 说明                         |
|---------------|-------------|------|------------------------------|
| `timestamp`   | `string`    | 是   | ISO 8601 修改时间            |
| `modifiedBy`  | `object/string` | 是 | 修改者信息                |

## 4. Data 对象
| 字段          | 类型               | 必填 | 说明                         |
|---------------|--------------------|------|------------------------------|
| `type`        | `string`           | 是   | `hybrid/legacy/minimal`      |
| `content`     | `array/object/null`| 是   | 根据 type 变化               |
| `dependencies`| `array`            | 否   | 引用其他数据                 |

## 5. Content 结构示例
### Hybrid 类型
```json
{
  "content": [
    {
      "raw": "<xml>...</xml>",
      "parsed": {
        "value": 42,
        "unit": "€"
      }
    },
    {
      "binary": "BASE64_DATA",
      "signature": {
        "algorithm": "RSA-4096"
      }
    }
  ]
}
```

### Legacy 类型
```json
{
  "content": {
    "text": "Legacy record",
    "backupLocations": [
      "s3://bucket/backup1"
    ]
  }
}
```

## 6. 引用关系
| 引用格式              | 示例                     | 说明               |
|-----------------------|--------------------------|--------------------|
| `#/{index}`           | `"$ref": "#/1"`          | 引用数组第2个元素  |
| `#/path/to/field`     | `"$ref": "#/0/data/content/0"` | 引用具体字段 |

## 7. 完整示例
```json
[
  {
    "_id": "5f8d0a3e5e1c6d3a9c8b7e1f",
    "metadata": {
      "createdAt": "2023-11-15T14:30:00.000Z",
      "lastModified": {
        "timestamp": "2023-11-20T09:45:23.000Z",
        "modifiedBy": {
          "userId": "user_789",
          "session": {
            "ip": "10.0.0.113"
          }
        }
      }
    },
    "data": {
      "type": "hybrid",
      "content": [
        {
          "raw": "<xml><value>42</value></xml>"
        }
      ]
    }
  }
]
```

